import styled from 'styled-components'
import HighlightOffIcon from '@mui/icons-material/HighlightOff';
import EditIcon from '@mui/icons-material/Edit';
function Todo() {

  return (
    <Container>
        <input />
        <IconContent>
        <HighlightOffIcon/>
        <EditIcon/>
        </IconContent>
    </Container>
  )
}

