    90deg,
    rgba(255, 118, 20, 1) 0%,
    rgba(255, 84, 17, 1) 100%
  );

input{
    border:none;
    flex:1;
    height:20px;
    background-color:transparent;
    font:inherit;
    :focus{
        outline: none;
    }
}

`


